'function appendGmailRealTime() {',
'    var emailField = document.getElementById(''P3_EMAIL'');',
'    var email = emailField.value;',
'',
'    if (email.length > 0) {',
'        if (email.indexOf(''@'') === -1) {',
'            // Append @gmail.com if ''@'' is not found',
'            emailField.value = email + ''@gmail.com'';',
'',
'            // Set cursor position before @gmail.com',
'            emailField.setSelectionRange(email.length, email.length);',
'        } else {',
'            var parts = email.split(''@'');',
'            emailField.value = parts[0] + ''@gmail.com'';',
'',
'            // Set cursor position before @gmail.com',
'            emailField.setSelectionRange(parts[0].length, parts[0].length);',
'        }',
'    }',
'}',
'',
'function toggleDarkMode() {',
'  document.body.classList.toggle("dark-mode");',
'  if (document.body.classList.contains("dark-mode")) {',
'    localStorage.setItem("theme", "dark");',
'  } else {',
'    localStorage.setItem("theme", "light");',
'  }',
'}'))
,p_javascript_code_onload=>wwv_flow_string.join(wwv_flow_t_varchar2(
