,p_process_sequence=>30
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Delete Vendor'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_name           vendors.name%TYPE := :P3_NAME; -- Adjust to your page item',
'    v_contact_person vendors.contact_person%TYPE;',
'    v_phone          vendors.phone%TYPE;',
'    v_email          vendors.email%TYPE;',
'    v_address        vendors.address%TYPE;',
'    v_gst_number     vendors.gst_number%TYPE;',
'    v_created_at     vendors.created_at%TYPE;',
'    v_json           VARCHAR2(4000);',
'BEGIN',
'    -- Step 1: Get the row by NAME',
'    SELECT contact_person, phone, email, address, gst_number, created_at',
'    INTO v_contact_person, v_phone, v_email, v_address, v_gst_number, v_created_at',
'    FROM vendors',
'    WHERE name = v_name',
'    AND ROWNUM = 1;',
'',
'    -- Step 2: Prepare JSON string',
'    v_json := ''{'' ||',
'              ''"name": "'' || v_name || ''", '' ||',
'              ''"contact_person": "'' || v_contact_person || ''", '' ||',
'              ''"phone": "'' || v_phone || ''", '' ||',
'              ''"email": "'' || v_email || ''", '' ||',
'              ''"address": "'' || v_address || ''", '' ||',
'              ''"gst_number": "'' || v_gst_number || ''", '' ||',
'              ''"created_at": "'' || TO_CHAR(v_created_at, ''YYYY-MM-DD HH24:MI:SS'') || ''"'' ||',
'              ''}'';',
'',
'    -- Step 3: Insert into backup',
'    INSERT INTO deleted_records_backup (',
'        id, table_name, deleted_by, record_data',
'    ) VALUES (',
'        deleted_records_seq.NEXTVAL,',
'        ''vendors'',',
'        :APP_USER,  -- works if authentication is enabled; otherwise use NULL or static name',
'        v_json',
'    );',
'',
'    -- Step 4: Delete the original row',
'    DELETE FROM vendors WHERE name = v_name AND ROWNUM = 1;',
'',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>'Vendor Not Deleted'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(37097245889644159801)
,p_process_success_message=>'Vendor Deleted'
,p_internal_uid=>37097246116806159804
);
end;
