 p_id=>wwv_flow_imp.id(37141119878044328014)
,p_process_sequence=>20
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'delete_order_byuserid'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_user_id          orders.user_id%TYPE := :P5_USER_ID;  -- Replace with your page item',
'    v_order_id         orders.order_id%TYPE;',
'    v_total_amount     orders.total_amount%TYPE;',
'    v_order_status     orders.order_status%TYPE;',
'    v_payment_status   orders.payment_status%TYPE;',
'    v_shipping_address orders.shipping_address%TYPE;',
'    v_created_at       orders.created_at%TYPE;',
'    v_json             VARCHAR2(4000);',
'BEGIN',
'    -- Step 1: Fetch the row',
'    SELECT order_id, total_amount, order_status, payment_status, shipping_address, created_at',
'    INTO v_order_id, v_total_amount, v_order_status, v_payment_status, v_shipping_address, v_created_at',
'    FROM orders',
'    WHERE user_id = v_user_id',
'    AND ROWNUM = 1;',
'',
'    -- Step 2: Prepare JSON',
'    v_json := ''{'' ||',
'              ''"user_id": "'' || v_user_id || ''", '' ||',
'              ''"order_id": "'' || v_order_id || ''", '' ||',
'              ''"total_amount": "'' || v_total_amount || ''", '' ||',
'              ''"order_status": "'' || v_order_status || ''", '' ||',
'              ''"payment_status": "'' || v_payment_status || ''", '' ||',
'              ''"shipping_address": "'' || v_shipping_address || ''", '' ||',
'              ''"created_at": "'' || TO_CHAR(v_created_at, ''YYYY-MM-DD HH24:MI:SS'') || ''"'' ||',
'              ''}'';',
'',
'    -- Step 3: Backup insert',
'    INSERT INTO deleted_records_backup (',
'        id, table_name, deleted_by, record_data',
'    ) VALUES (',
'        deleted_records_seq.NEXTVAL,',
'        ''orders'',',
'        :APP_USER,  -- or ''admin'' if no login',
'        v_json',
'    );',
'',
'    -- Step 4: Delete the row',
'    DELETE FROM orders WHERE user_id = v_user_id AND ROWNUM = 1;',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(35777975476743517272)
,p_process_success_message=>'Order Deleted Succesfully'
,p_internal_uid=>37141119878044328014
);
end;
