,p_process_sequence=>20
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'delete_customer_byname'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_name         customers.name%TYPE := :P6_NAME;  -- Adjust to your page item',
'    v_customer_id  customers.customer_id%TYPE;',
'    v_email        customers.email%TYPE;',
'    v_phone        customers.phone%TYPE;',
'    v_address      customers.address%TYPE;',
'    v_total_orders customers.total_orders%TYPE;',
'    v_total_spent  customers.total_spent%TYPE;',
'    v_joined_on    customers.joined_on%TYPE;',
'    v_json         VARCHAR2(4000);',
'BEGIN',
'    -- Step 1: Get the row by NAME',
'    SELECT customer_id, email, phone, address, total_orders, total_spent, joined_on',
'    INTO v_customer_id, v_email, v_phone, v_address, v_total_orders, v_total_spent, v_joined_on',
'    FROM customers',
'    WHERE name = v_name',
'    AND ROWNUM = 1;',
'',
'    -- Step 2: Prepare JSON string',
'    v_json := ''{'' ||',
'              ''"name": "'' || v_name || ''", '' ||',
'              ''"customer_id": "'' || v_customer_id || ''", '' ||',
'              ''"email": "'' || v_email || ''", '' ||',
'              ''"phone": "'' || v_phone || ''", '' ||',
'              ''"address": "'' || v_address || ''", '' ||',
'              ''"total_orders": "'' || v_total_orders || ''", '' ||',
'              ''"total_spent": "'' || v_total_spent || ''", '' ||',
'              ''"joined_on": "'' || TO_CHAR(v_joined_on, ''YYYY-MM-DD HH24:MI:SS'') || ''"'' ||',
'              ''}'';',
'',
'    -- Step 3: Insert into backup',
'    INSERT INTO deleted_records_backup (',
'        id, table_name, deleted_by, record_data',
'    ) VALUES (',
'        deleted_records_seq.NEXTVAL,',
'        ''customers'',',
'        :APP_USER,  -- Optional: use NULL if no user tracking',
'        v_json',
'    );',
'',
'    -- Step 4: Delete the original row',
'    DELETE FROM customers WHERE name = v_name AND ROWNUM = 1;',
'',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(34516422228705398509)
,p_process_success_message=>'Customer Deleted Succesfully'
,p_internal_uid=>37097246338978159806
);
end;
