,p_process_sequence=>20
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'delete_expense_bytype'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_expense_type    expenses.expense_type%TYPE := :P9_EXPENSE_TYPE;  -- Adjust to your page item',
'    v_expense_id      expenses.expense_id%TYPE;',
'    v_amount          expenses.amount%TYPE;',
'    v_description     expenses.description%TYPE;',
'    v_expense_date    expenses.expense_date%TYPE;',
'    v_json            VARCHAR2(4000);',
'BEGIN',
'    -- Step 1: Get the row by EXPENSE_TYPE',
'    SELECT expense_id, amount, description, expense_date',
'    INTO v_expense_id, v_amount, v_description, v_expense_date',
'    FROM expenses',
'    WHERE expense_type = v_expense_type',
'    AND ROWNUM = 1;',
'',
'    -- Step 2: Prepare JSON string',
'    v_json := ''{'' ||',
'              ''"expense_type": "'' || v_expense_type || ''", '' ||',
'              ''"expense_id": "'' || v_expense_id || ''", '' ||',
'              ''"amount": "'' || v_amount || ''", '' ||',
'              ''"description": "'' || v_description || ''", '' ||',
'              ''"expense_date": "'' || TO_CHAR(v_expense_date, ''YYYY-MM-DD HH24:MI:SS'') || ''"'' ||',
'              ''}'';',
'',
'    -- Step 3: Insert into backup',
'    INSERT INTO deleted_records_backup (',
'        id, table_name, deleted_by, record_data',
'    ) VALUES (',
'        deleted_records_seq.NEXTVAL,',
'        ''expenses'',',
'        :APP_USER,  -- works if authentication is enabled; otherwise use NULL or static name',
'        v_json',
'    );',
'',
'    -- Step 4: Delete the original row',
'    DELETE FROM expenses WHERE expense_type = v_expense_type AND ROWNUM = 1;',
'',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>'Expense Could Not Be Deleted'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(34517040843028405703)
,p_process_success_message=>'Expense Deleted Succesfully'
,p_internal_uid=>37143385925419392004
);
end;
