,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'delete_purchase_byitem'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_item_name   purchase_orders.item_name%TYPE := :P12_ITEM_NAME;  -- replace with your page item',
'    v_po_id       purchase_orders.po_id%TYPE;',
'    v_vendor_id   purchase_orders.vendor_id%TYPE;',
'    v_quantity    purchase_orders.quantity%TYPE;',
'    v_unit_price  purchase_orders.unit_price%TYPE;',
'    v_total_price purchase_orders.total_price%TYPE;',
'    v_order_date  purchase_orders.order_date%TYPE;',
'    v_status      purchase_orders.status%TYPE;',
'    v_json        VARCHAR2(4000);',
'BEGIN',
'    -- Step 1: Fetch the row',
'    SELECT po_id, vendor_id, quantity, unit_price, total_price, order_date, status',
'    INTO v_po_id, v_vendor_id, v_quantity, v_unit_price, v_total_price, v_order_date, v_status',
'    FROM purchase_orders',
'    WHERE item_name = v_item_name',
'    AND ROWNUM = 1;',
'',
'    -- Step 2: Prepare JSON',
'    v_json := ''{'' ||',
'              ''"item_name": "'' || v_item_name || ''", '' ||',
'              ''"po_id": "'' || v_po_id || ''", '' ||',
'              ''"vendor_id": "'' || v_vendor_id || ''", '' ||',
'              ''"quantity": "'' || v_quantity || ''", '' ||',
'              ''"unit_price": "'' || v_unit_price || ''", '' ||',
'              ''"total_price": "'' || v_total_price || ''", '' ||',
'              ''"order_date": "'' || TO_CHAR(v_order_date, ''YYYY-MM-DD HH24:MI:SS'') || ''", '' ||',
'              ''"status": "'' || v_status || ''"'' ||',
'              ''}'';',
'',
'    -- Step 3: Insert into backup',
'    INSERT INTO deleted_records_backup (',
'        id, table_name, deleted_by, record_data',
'    ) VALUES (',
'        deleted_records_seq.NEXTVAL,',
'        ''purchase_orders'',',
'        :APP_USER,  -- or replace with static name',
'        v_json',
'    );',
'',
'    -- Step 4: Delete the original row',
'    DELETE FROM purchase_orders WHERE item_name = v_item_name AND ROWNUM = 1;',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>'Purchase Could Not Be Deleted'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(34518437306011419651)
,p_process_success_message=>'Purchase Deleted Succesfully'
,p_internal_uid=>37145515352609458249
);
