,p_process_name=>'salesummary_delete'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_summary_id     sales_summary.summary_id%TYPE := :P15_SUMMARY_ID;  -- replace with your APEX item',
'    v_summary_date   sales_summary.summary_date%TYPE;',
'    v_total_orders   sales_summary.total_orders%TYPE;',
'    v_total_revenue  sales_summary.total_revenue%TYPE;',
'    v_total_profit   sales_summary.total_profit%TYPE;',
'    v_json           VARCHAR2(4000);',
'BEGIN',
'    -- Step 1: Fetch the row',
'    SELECT summary_date, total_orders, total_revenue, total_profit',
'    INTO v_summary_date, v_total_orders, v_total_revenue, v_total_profit',
'    FROM sales_summary',
'    WHERE summary_id = v_summary_id;',
'',
'    -- Step 2: Convert to JSON',
'    v_json := ''{'' ||',
'              ''"summary_id": "'' || v_summary_id || ''", '' ||',
'              ''"summary_date": "'' || TO_CHAR(v_summary_date, ''YYYY-MM-DD'') || ''", '' ||',
'              ''"total_orders": "'' || v_total_orders || ''", '' ||',
'              ''"total_revenue": "'' || v_total_revenue || ''", '' ||',
'              ''"total_profit": "'' || v_total_profit || ''"'' ||',
'              ''}'';',
'',
'    -- Step 3: Insert into backup',
'    INSERT INTO deleted_records_backup (',
'        id, table_name, deleted_by, record_data',
'    ) VALUES (',
'        deleted_records_seq.NEXTVAL,',
'        ''sales_summary'',',
'        :APP_USER,  -- Or use ''admin'' or any user ID',
'        v_json',
'    );',
'',
'    -- Step 4: Delete the row',
'    DELETE FROM sales_summary WHERE summary_id = v_summary_id;',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>'Sale Summary not deleted'
